import React, { Component } from 'react';
import WorldMap from './WorldMap';
import LocalGame from './LocalGame';
import "./app.css"

class App extends Component {
  componentWillMount() {
    this.setState({ 
      city: false, 
      playing: false,
      map: InitialGrid(),
      ticker: -1,
      playableCities: [],
      flyingZombies: false
    });
  }

  setSelected(city) {
    this.setState({ city: city });
  };

  startGame() {
    this.setState({ playing: true });
  }

  updateState(map, ticker) {
    this.setState({ map: map, ticker: ticker });
  }

  clearCity() {
    this.setState({ city: false });
  }

  activateCity(newCity) {
    if(this.state.playableCities.includes(newCity) === false) {
      this.setState({ playableCities: [this.state.playableCities, newCity].flat()});
    }
  }

  flyingZombies() {
    if (this.state.playableCities.length > 10 && this.state.flyingZombies ===false) {
      this.setState({ flyingZombies: true });
    }
  }

  renderButtons() {
    const cities = this.state.playableCities
    return(cities.map((city, index) => {
      return(
        <button className="city-button" 
                key={index}
                title={city} 
                onClick={() => { this.setSelected(city) }}></button>
      )
    }))
  }

  render() {
    this.flyingZombies()
    if (!this.state.playing) {
      return (
        <div>
          <h1 id="main-title" className="center">TRICK OR EAT BRAINS</h1>
          <button onClick={() => { this.startGame() }} id="start-button" className="center">START</button>  
        </div>
      );
    } else if (this.state.city) {
      return (
        <div>
          <LocalGame city={this.state.city} clearCity={this.clearCity.bind(this)}/>
        </div>
      );
    } else {
      return (
        <div>
          {this.state.city}
          <WorldMap map={this.state.map}
                    updateAppMap={this.updateState.bind(this)}
                    ticker={this.state.ticker}
                    activateCity={this.activateCity.bind(this)}
                    flyingZombies={this.state.flyingZombies}
                    />
          {this.renderButtons()}
        </div>
      )
    }
  }
}

export default App;

